class HeroModel {
	RightArm=false;
	LeftArm=false;
	Nose=0;
	X=0;
	Y=0;
	Health = 100;
	constructor(){
		this.Health = 50;		
	};
	MinusHealth= function(Minus){
		Health -=Minus;
	};
}
export { HeroModel }
